public abstract class Ability : ScriptableObject
  public abstract void Use(Vector3 playerPosition, Vector3 useDirection, Vector3 targetPosition)

public class ShootBulletAbility : Ability
  
  [SerializeField] private GameObject bulletPrefab;
  [SerializeField] private float speed;
  [SerializeField] private damage;

  public override void Use(Vector3 playerPosition, Vector3 useDirection, Vector3 targetPosition)
    var bullet = Instantiate (bulletPrefab); // maybe class Bullet
    bullet.transform.position = playerPosition;
    bullet.transform.forward = useDirection;
    bullet.SetDamage(damage);
    bullet.rigidBody.AddForce(speed);


 public class Player : MonoBehaviour
   public Ability PrimaryAbility {get; private set;}

   public void SetPrimary(Ability ability)
     PrimaryAbility = ability;

   public void UsePrimary()
     var target = GetTarget();
     PrimaryAbility?.Use(transform.position, transform.forward, target);

#pragma warning(disable : 4996)
#include <iostream>
#include <fstream>
#include <cstring>
#include <vector>
#include <string>
#include <algorithm>
#include <stdio.h> 
#include <Windows.h>
#include <iomanip>


//структура car
struct Car {
    char* brand;
    char* firstname;
    char* secondname;
    int power;
    int mileage;//пробег
    // Конструктор для инициализации указателя brand
    Car() : brand(new char[1] {}), firstname(new char[1] {}), secondname(new char[1] {}), power(0), mileage(0) {}

    // Деструктор для освобождения памяти
    /*~Car() {
        delete[] brand;
        delete[] firstname;
        delete[] secondname;
    }*/
};

void AddCar(std::vector<Car>& cars)
{
    Car newcar;
    std::cout << "Введите данные автомобиля:\n";

    std::cout << "Марка машины: ";
    std::string brand;
    std::getline(std::cin >> std::ws, brand);
    newcar.brand = new char[brand.length() + 1];
    strcpy(newcar.brand, brand.c_str());

    std::cout << "Фамилия владельца: ";
    std::string secondname;
    std::getline(std::cin >> std::ws, secondname);
    newcar.secondname = new char[secondname.length() + 1];
    strcpy(newcar.secondname, secondname.c_str());

    std::cout << "Имя Владельца: ";
    std::string firstname;
    std::getline(std::cin >> std::ws, firstname);
    newcar.firstname = new char[firstname.length() + 1];
    strcpy(newcar.firstname, firstname.c_str());

    std::cout << "Мощность двигателя: ";
    std::cin >> newcar.power;

    std::cout << "Пробег: ";
    std::cin >> newcar.mileage;

    cars.push_back(newcar);

    std::cout << "Машина добавлена!\n";
}

void PrintInfo(const std::vector<Car>& cars)
{

    // Вывод заголовков таблицы
    std::cout << std::left << std::setw(20) << "Марка машины";
    std::cout << std::left << std::setw(10) << "Мощность";
    std::cout << std::left << std::setw(15) << "Фамилия";
    std::cout << std::left << std::setw(10) << "Имя";
    std::cout << std::left << std::setw(10) << "Пробег";
    std::cout << '\n';

    // Вывод разделителя
    for (int i = 0; i < 100; i++)
        std::cout << "-";
    std::cout << '\n';

    // Вывод информации о машине
    for (int i = 0; i < cars.size(); i++)
    {
        std::cout << std::left << std::setw(20) << cars[i].brand;
        std::cout << std::left << std::setw(10) << cars[i].power;
        std::cout << std::left << std::setw(15) << cars[i].secondname;
        std::cout << std::left << std::setw(10) << cars[i].firstname;
        std::cout << std::left << std::setw(10) << cars[i].mileage;
        std::cout << '\n';
    }

    // Вывод разделителя
    for (int i = 0; i < 100; i++)
        std::cout << "-";
    std::cout << "\n Количество записей в базе " << cars.size() << '\n';

}

void FindBrand(std::vector<Car>& cars)
{
    std::cout << "Введите марку авто, которые вы хотите найти: ";
    std::string brand;
    std::cin >> brand;
    for (int i = 0; i < cars.size(); i++)
        if (std::string(cars[i].brand) == brand)
        {
            std::cout << "Вот вся информация о машине №" << (i + 1);
            std::cout << "\nМарка машины: " << cars[i].brand;

            std::cout << "\nФамилия владельца: " << cars[i].secondname;

            std::cout << "\nИмя Владельца: " << cars[i].firstname;

            std::cout << "\nМощность двигателя : " << cars[i].power;

            std::cout << "\nПробег: " << cars[i].mileage << "\n\n";
        }
}

void  FindMileage(std::vector<Car>& cars)
{
    std::cout << "Введите пробег для поиска авто больше заданного: ";
    int mileage;
    std::cin >> mileage;
    std::vector<std::string> lf;
    for (int i = 0; i < cars.size(); i++)
        if (cars[i].mileage > mileage)
            lf.push_back(std::string(cars[i].secondname) + " " + std::string(cars[i].firstname));
    std::sort(lf.begin(), lf.end());
    std::cout << "\nВот все найденные владельцы авто, с пробегом больше заданного:\n ";
    for (int i = 0; i < lf.size(); i++)
        std::cout << lf[i] << '\n';

}
int main() {
    SetConsoleCP(1251); SetConsoleOutputCP(1251);//русский язык
    int maxSize;
    std::cout << "Введите количество машин: ";
    std::cin >> maxSize;
    std::vector<Car> cars;
    for (int i = 0; i < maxSize; i++)
    {
        std::cout << "Введите данные авто №" << (i + 1) << '\n';
        AddCar(cars);
    }
    while (true)
    {
        std::cout << "Напиши номер действия, которое вы хотите выполнить:\n";
        std::cout << "1.Добавить новую машину\n";
        std::cout << "2.распечатать информацию о машине в табличном виде\n";
        std::cout << "3.Найти машины по марке\n";
        std::cout << "4.найти всех владельцев с пробегом машины больше заданного \n";
        std::cout << "5.Выход \n";
        int n;
        std::cin >> n;
        switch (n)
        {
        case 1:
            AddCar(cars);
            break;
        case 2:
            PrintInfo(cars);
            break;
        case 3:
            FindBrand(cars);
            break;
        case 4:
            FindMileage(cars);
            break;
        case 5:
            return 0;
        default:
            std::cout << "Введите корректное число!\n";
            continue;
        }
    }
    return 0;
}

public interface IAblity
  void Use(Vector3 direction)

public abstract class BaseAbilityTemplate : ScriptableObject
  public abstract IAbility CreateInstance()

public class ShootingAbilityTemplate : BaseAbilityTemplate
  public GameObject bulletPrefab;
  public float speed;
  public float damage;

  public override IAbility CreateInstance()
    return new ShotBulletAbility(this);

public abstract class BaseAbility<T> : IAblity
  where T : BaseAbilityTemplate
  
  puplic T Template {get; private set}
  public BaseAbility(T template)
    Template = template;
  
  public abstract void Use(Vector3 direction)

class ShotBulletAbility : BaseAbility<ShootingAbilityTemplate>  
  
  public override void Use(Vector3 direction)
    var bullet = Instantiate (Template.bulletPrefab); // maybe class Bullet
    bullet.transform.forward = direction;
    bullet.rigidBody.AddForce(Template.speed);
    bullet.SetDamage(Template.damage);

public class Weapon
  // some other fields required for all weapon

  public IAbility Ability { get; private set; }
  private Transform _parent;
 
  public Weapon(IAbility ability, Transform parent)
    Ability = ability;
    _parent = parent;

  public void Fire()
    Ability.Use(_parent.forward);
  

public static class WeaponFactory
  public static Weapon CreateWeapon(BaseAbilityTemplate template, Transform weaponParent)
    var ability = template.CreateInstance();
    var weapon = new Weapon(ability, weaponParent);
    return weapon;

