class Solution {
public:

void bfs(int row,int col, vector<vector<int>> &vis, vector<vector<char>> &grid){
        vis[row][col]=1;
        queue<pair<int,int>> q;
        int n = grid.size();
        int m = grid[0].size();
        q.push({row,col});
        while(!q.empty()){
            int row = q.front().first;
            int col = q.front().second;
            q.pop();
	    //for neighbouring elements or cell.
	    //you could use direct indexes too :)
            for(int del_row=-1;del_row<=1;del_row++){
                for(int del_col=-1;del_col<=1;del_col++){
		    //not to check the diagonal elements.
                    if((del_row==-1&&del_col==-1) || (del_row==-1&&del_col==1) || (del_row==1&&del_col==-1) || (del_row==1&&del_col==1)){
                        continue;
                    }
                    int nrow=row+del_row;
                    int ncol=col+del_col;
                    if(nrow>=0 && nrow<n && ncol>=0 && ncol<m && grid[nrow][ncol]=='1' && !vis[nrow][ncol]){
                        vis[nrow][ncol]=1;
                        q.push({nrow,ncol});
                    }
                }
            }
        }
    }
    
    int numIslands(vector<vector<char>>& grid) {
        int n = grid.size();
        int m = grid[0].size(), cnt=0;
        vector<vector<int>> vis(n, vector<int>(m,0));
        for(int row=0;row<n;row++){
            for(int col=0;col<m;col++){
                if(!vis[row][col] && grid[row][col]=='1'){
                    bfs(row,col,vis,grid);
                    cnt++;
                }
            }
        }
        return cnt;
    }
};

#include <iostream>
#include <vector>

using namespace std;

void update(vector<int> &fenwick, int index, int value) {
    while (index < fenwick.size()) {
        fenwick[index] += value;
        index += index & -index;
    }
}
int getSum(const vector<int> &fenwick, int index) {
    int sum = 0;
    while (index) {
        sum += fenwick[index];
        index -= index & -index;
    }
    return sum;
}

int main() {
    int n; cin >> n;
    string s, t; cin >> s >> t;
    vector<int> positions[26];
    for (int i = n-1; i >= 0; --i) positions[s[i]-'A'].push_back(i);
    
    vector<int> fenwick(1+n);

    long long moves = 0;
    for (int i = 0; i < n; ++i) {
        int cur = positions[t[i]-'A'].back();
        positions[t[i]-'A'].pop_back();
        moves = moves + (cur+getSum(fenwick, n-cur))-i;
        update(fenwick, n-cur, +1);
    }
    cout << moves << endl;
    return 0;
}

package CC4PlayGround;

import java.util.Objects;
import java.util.Random;

public class CC4Playground {
    /*Global Variables*/
    String[][] board;
    Boolean winner;
    Boolean draw;
    int winningPlayer; 
    int playerTurn;

    /*Constructor*/
    public CC4Playground(){
        winningPlayer = 0;
        draw = false;
        playerTurn = 1;
        board = new String[6][7];
        newGameBoard();
        displayBoard();
    }

    /*provide a better look for the board*/
    private void newGameBoard(){
        for(int i = 0; i < board.length; i++){
            for(int j = 0; j < board[0].length; j++){ 
                board[i][j] = " - ";
            }
        }
    }

    private void displayBoard(){
        System.out.println(" ");
        System.out.println(" *** Connect 4 *** ");
        System.out.println(" ");
        System.out.println(" 0  1  2  3  4  5  6");
        for(int i = 0; i < board.length; i++){
            for(int j = 0; j < board[0].length; j++){
                if( board[i][j].length() == 1)
                    System.out.print(" " + board[i][j]+ " ");
                else
                    System.out.print(board[i][j]);
            }
            System.out.println();
        }
        System.out.println();
    }

    /*the column is full*/
    private boolean isColumnFull(int col){
        return getNextAvailableSlot(col) == -1;
    }

    /*return the next available row pos of a given column*/
    private int getNextAvailableSlot(int col){

        int rows = board.length;
        int cols = board[0].length;

        for(int pos = rows-1; pos >= 0; --pos) {
            if(board[pos][col] == " - " ){
                return pos;

            }

        }
        return -1;
    }

    /* swaps turn for current player */
    private void swapPlayerTurn(){
        if(playerTurn == 1){
            playerTurn = 2; 
        } else {
            playerTurn = 1;
        }
    }
    private void placePiece(){ 

      switch(playerTurn){
          case 1:
            System.out.println("Player X " + playerTurn + " please select which col to place your piece (1-7)");
            String input = new java.util.Scanner(System.in).nextLine();
            int colChoice = Integer.parseInt(input) - 1;
              String pieceToPlace = "X";
              // todo ohne isColumnFull prüfen geht der Spiel unendlich
              if(!isColumnFull(colChoice))
                board[getNextAvailableSlot(colChoice)][colChoice] = pieceToPlace;
              displayBoard();
              //decideWinner();
              swapPlayerTurn();
              break;
          case 2:
              System.out.println("Player O  " + playerTurn + " places the piece");
              Random rdm = new Random();
              colChoice = rdm.nextInt(6)+1;
              pieceToPlace = "O";

              if(!isColumnFull(colChoice))
                board[getNextAvailableSlot(colChoice)][colChoice] = pieceToPlace;

              displayBoard();
              swapPlayerTurn();
              break;
          default:
              System.out.println("no valid turn");
              break;
              //swapPlayerTurn();
      }
      //decideWinner();
      //decideWinner(board);

    }

    private final int MATCHES = 4;

    private boolean didWinleft(String player) {
        int rows = board.length;
        int cols = board[0].length;

        for(int i = 0; i < rows; i++){
            for(int j = 0; j <= cols-MATCHES; j++){

                if( board[i][j] == player)
                {
                    boolean ab = board[i][j] == board[i][j+1];
                    boolean cd = board[i][j+1] == board[i][j+2];
                    boolean de = board[i][j+2] == board[i][j+3];

                    if(ab && cd && de){
                        return true;
                    }
                }
            }
        }

        return false;
    }

    private boolean didWinup(String player) {
        int rows = board.length;
        int cols = board[0].length;

        for(int i = 0; i <= rows-MATCHES; i++){
            for(int j = 0; j < cols; j++){

                if( board[i][j] == player)
                {
                    boolean ab = board[i][j] == board[i+1][j];
                    boolean cd = board[i+1][j] == board[i+2][j];
                    boolean de = board[i+2][j] == board[i+3][j];

                    if(ab && cd && de){
                        return true;
                    }
                }
            }
        }

        return false;
    }

    private boolean didWinleftup(String player) {
        int rows = board.length;
        int cols = board[0].length;

        for(int i = 0; i <= rows-MATCHES; i++){
            for(int j = 0; j <= cols-MATCHES; j++){

                if( board[i][j] == player)
                {
                    boolean ab = board[i][j] == board[i+1][j+1];
                    boolean cd = board[i+1][j+1] == board[i+2][j+2];
                    boolean de = board[i+2][j+2] == board[i+3][j+3];

                    if(ab && cd && de){
                        return true;
                    }
                }
            }
        }

        return false;
    }

    private boolean didWinRightup(String player) {
        int rows = board.length;
        int cols = board[0].length;

        for(int i = rows-MATCHES; i >= 0; i--){
            for(int j = cols-MATCHES; j >= 0; j--){

                if( board[i][j] == player)
                {
                    boolean ab = board[i][j] == board[i+1][j+1];
                    boolean cd = board[i+1][j+1] == board[i+2][j+2];
                    boolean de = board[i+2][j+2] == board[i+3][j+3];

                    if(ab && cd && de){
                        return true;
                    }
                }
            }
        }

        return false;
    }

    public void playGame(){
        while(winningPlayer == 0){

            placePiece();

            String[] players = new String[]{"X", "O"};

            for(String player : players){
                boolean didWin = didWinRightup(player);
                didWin |= didWinleftup(player);
                didWin |= didWinup(player);
                didWin |= didWinleft(player);

                if(didWin){
                    System.out.println("gewonnen " + player);
                }
            }
        }
    }

    public static void main(String[] args) {
        CC4Playground main = new CC4Playground(); 
        main.playGame();

    }
}

package objectsAndClasses;

import java.util.ArrayList;
import java.util.List;
import java.util.Scanner;

public class P05Students {
    public static class Student {
        String firstName;
        String lastName;
        String age;
        String town;

        public Student (String firstName, String lastName, String age, String town) {
            this.firstName = firstName;
            this.lastName = lastName;
            this.age = age;
            this.town = town;
        }

        public String getTown() {
            return this.town;
        }

        public String getFirstName() {
            return this.firstName;
        }

        public String getLastName() {
            return this.lastName;
        }

        public String getAge() {
            return this.age;
        }
    }

    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);

        List<Student> studentsList = new ArrayList<>();

        String input = scanner.nextLine();
        while (!input.equals("end")) {
            String[] studentsDataArr = input.split(" ");
            String firstName = studentsDataArr[0];
            String lastName = studentsDataArr[1];
            String age = studentsDataArr[2];
            String town = studentsDataArr[3];

            Student currentStudent = new Student(firstName, lastName, age, town);

            studentsList.add(currentStudent);

            input = scanner.nextLine();
        }

        String homeTown = scanner.nextLine();

        for (Student student: studentsList) {
            if (student.getTown().equals(homeTown)) {
                System.out.printf("%s %s is %s years old%n",
                        student.getFirstName(), student.getLastName(), student.getAge());
            }
        }
    }
}

use core::arch::asm;

pub fn outb(port: u16, value: u8) {
	unsafe {
		asm!(
			"out dx, al", 
			in("dx") port, 
			in("al") value, 
		);
	}
}

pub fn inb(port: u16) -> u8 {
	let mut value: u8;
	unsafe {
		asm!(
			"in al, dx", 
			out("al") value, 
			in("dx") port, 
		);
	}
	return value;
}

